import React from 'react';
import './Home.css';
import { UserOutlined, HeaderSearch } from '@ant-design/icons';
import { Avatar, Card } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { Input, Space } from 'antd';



function Home() {
    const { Search } = Input;
const suffix = (
  <AudioOutlined
    style={{
      fontSize: 16,
      color: '#1890ff',
    }}
  />
);
const onSearch = (value) => console.log(value);
  return (
    <>
      <Card  hoverable style={{width: 570}}
     className="site-card-border-less-wrapper card">>
        <Search
        placeholder="input search text"
        enterButton="Search"
        size="large"
        suffix={suffix}
        onSearch={onSearch}
        />
      <Avatar size={64} icon={<UserOutlined />} />
      </Card>
    </>
  )
}

export default Home
